import {getConnection} from '../database/database';
const multer = require('multer');
const getZodiaco = async (req, res) => {
    try{
        const conex = await getConnection();
        const result = await conex.query('select * from signos');
        res.status(200).json({
            "status_code": 200,
            "status_message": "OK",
            "content":result[0]});
    }catch (error) {
        res.status(500).json({
            "status_code": 500,
            "status_message": "Internal Server Error",
            "content":error.message
        });
    }
}

const addZodiaco = async (req, res, next) => {
    try{
        const id= req.body.id;
        const nombre = req.body.nombre;
        const periodo = req.body.periodo;
        const mime = req.file.mimetype;
        const image = req.file.buffer.toString('base64');
        console.log(image);
        const datos = {id, nombre, periodo, image, mime};

        /*let fs = require('fs');
        fs.readFile(req.file.path, function (err, data) {
            if (err) throw err; // Fail if the file can't be read.
            console.log('File read!');

            // Make sure there's data before we post it
            if(data) {
                console.log('File data!');
                console.log(data);
                //var image = new Buffer(data, 'binary');
                //console.log(image);

                //var image = new Buffer(data).toString('base64');
                //console.log(image);
                var image = data.toString("base64").toString();
                datos = {id, nombre, periodo, image, mime};
            }else {
                console.log('No File data!');
                datos = {id, nombre, periodo};
            }
        });
        */
        const conex = await getConnection();
        const result = await conex.query('insert into signos set ?',[datos]);
        res.status(201).json({
            "status_code": 201,
            "status_message": "Data was created",
            "content":result[0]});
    }catch (error) {
        res.status(500).json({
            "status_code": 500,
            "status_message": "Internal Server Error",
            "content":error.message,
            "sentence": error.sql
        });
    }
}

export const methods = {
    getZodiaco, addZodiaco
};

